import React,{useState, useEffect} from "react";
import './App.css';
import Results from './showResult';
import {Routes, Route, Outlet, Link} from 'react-router-dom';
import SearchBar from './searchBar';
import MainPage from "./main"


export default function App() {
    const [count, setCount] = useState(0);
    return(
        <div>
            <Routes>
                <Route path="/" element={<Layout/>}>
                <Route index element={<MainPage/> } />
                <Route path="Gallery" element={<Results/> } />
                <Route path="Search" element={[<SearchBar name ="name"/>]} />
                <Route path= "*" element={<D count={count} setCount ={setCount}/>} />
                </Route>
            </Routes>
        </div>
    )
};

function Layout() {
    return (
        <div>
            <div class = 'nav'>
            <item>
                <Link to ="/" class ="word">Home</Link>
            </item>
            <item>
                <Link to ="/Gallery" class ="word">Gallery</Link>
            </item>
            <item>
                <Link to ="/Search" class ="word">Search</Link>
            </item>
            <item>
                <Link to ="/bad" class ="word">Like</Link>
            </item>
            </div>
            <hr/>
            <Outlet/>
        </div>
      );
}


function D(props) {
    return (
        <div class ="body">
          <h2>There is no info for this page, but did you know {props.count} people has already liked our website !</h2>
          <h2>Click the button to be one of them!</h2>
          <button onClick = {()=>props.setCount(props.count + 1)}>Like</button>
          <p>
            <Link to="/">Go to the home page</Link>
          </p>
        </div>
      );
}
